function add(a,b){
    let sum = a + b;
    return sum;
}

function mul(a,b){
    let ml = a*b;
    return ml;
}

function sub(a,b){
    let subtrac = a-b;
    return subtrac;
}

function div(a,b){
    let divi = a/b;
    divi = divi.toFixed(2);
    return divi;
}
 export {add,mul,sub,div};
